function bufToHexStr(buffer) {
    return buffer.toString("hex")
}

function bufToInt(buffer) {
    return parseInt(bufToHexStr(buffer), 16)
}

function parseStateRoots(txData) {
    const calldata = Buffer.from(txData.slice(2), "hex")
    let ptr = 0

    const sighash = bufToHexStr(calldata.subarray(ptr, ptr + 4))
    ptr += 4
    
    const stateRoots = []
    while (ptr < calldata.length) {
        const stateRoot = calldata.subarray(ptr, ptr + 32)
        ptr += 32

        stateRoots.push(bufToHexStr(stateRoot))
    }

    return stateRoots
}

function parseLogs(txLogs) {
    const log = txLogs[0]
    const logData = Buffer.from(log.data.slice(2), "hex")

    const batchIndex = log.topics[1]
    const batchRoot = bufToHexStr(logData.subarray(0, 32))
    const batchSize = bufToInt(logData.subarray(32, 64))
    const prevTotalElements = bufToInt(logData.subarray(64, 96))
    const extraData = bufToHexStr(logData.subarray(96))

    return {
        batchIndex,
        batchRoot,
        batchSize,
        prevTotalElements,
        extraData,
    }
}

function getStateRootEntries(stateRoots, log) {
    const stateRootEntries = new Map()
    let padding = stateRoots.length - log.batchSize 

    for (let i = 0; i < log.batchSize; i++) {
        const key = log.prevTotalElements + 1 + i
        const value = stateRoots[padding + i]

        stateRootEntries.set(key, value)
    }
    return stateRootEntries
}

function validateStateRoots(blockInfo, stateRootEntries) {
    const blockNumber = parseInt(blockInfo.number, 16)
    const blockStateRoot = blockInfo.stateRoot.slice(2)

    if (stateRootEntries.get(blockNumber) === blockStateRoot) return true
    else return false
}

const stateRoots = parseStateRoots(L1StateRollupTxResponse.result.input)
const log = parseLogs(L1StateRollupTxReceiptResponse.result.logs)

const result = validateStateRoots(
    L2BlockInfoResponse.result[0],
    getStateRootEntries(stateRoots, log),
)
